import React from 'react';
import { Switch, Route, Redirect } from 'react-router-dom';
import LoginForm from './pages/forms/login';
import AdminDashboard from './pages/dashboard/adminDashboard';
import ProtectedRoute from './ProtectedRoutes'; // Import the ProtectedRoute component

function App() {
  return (
    <Switch>
      {/* Public route for login */}
      <Route path="/" exact component={LoginForm} />

      {/* Protected routes */}
      <ProtectedRoute path="/registerSociety" component={LoginForm} />
      <ProtectedRoute path="/registerSecretary" component={LoginForm} />
      <ProtectedRoute path="/adminDashboard" component={AdminDashboard} />

      {/* Redirect to login page if route not found */}
      <Route component={() => <Redirect to="/" />} />
    </Switch>
  );
}

export default App;
